import React from 'react';
import './Styles/Heading.css';

function Heading() {
    return (
        <button onclick="">
            <svg viewBox="0 0 1200 300">
                {/* Symbol */}
                <symbol id="s-text">
                    <text textAnchor="middle" x="50%" y="50%" dy=".35em">Maaxo</text>
                </symbol>  
                <use xlinkHref="#s-text" className="text" />
                <use xlinkHref="#s-text" className="text" />
                <use xlinkHref="#s-text" className="text" />
                <use xlinkHref="#s-text" className="text" />
                <use xlinkHref="#s-text" className="text" />
            </svg>
        </button>    
    );
}

export default Heading;
